  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of a
  swan nest survey that was conducted in 1985 on the Koyukuk National Wildlife Refuge
  and the northern unit of the Innoko National Wildlife Refuge in Alaska and in 1986
  on the northern part of the Koyukuk National Wildlife Refuge. Of the 18 nests that
  could be identified, 17 (94%) were tundra swan (Cygnus columbianus) nests and 1
  (6%) was a trumpeter swan (Cygnus buccinator) nest. A description of the area surveyed,
  methods used, and a discussion of the results is covered.\",\n\t\"license_title\":
